Natalia Stanislavovna Vieru (; born 25 July 1989) is a Russian &lt;a href="basketball"&gt;basketball&lt;/a&gt; player. She is a member of the &lt;a href="Russia%20women%27s%20national%20basketball%20team"&gt;Russia women's national basketball team&lt;/a&gt; and competed in the &lt;a href="2012%20Summer%20Olympics"&gt;2012 Summer Olympics&lt;/a&gt;. Vieru played last for the Russian club UMMC Ekaterinburg as a center from 2015-2020.
With six 1st places in the EuroLeague Women Championship, Vieru is second to &lt;a href="Diana%20Taurasi"&gt;Diana Taurasi&lt;/a&gt; as the player holding the most Euroleague Women titles (2019, 2018, 2016 - UMMC; 2010, 2009, 2008 - Sparta&amp;K M.R. Vidnoje).
National team.
At a height of Vieru was the tallest player in the Russian national team in 2018 and 2019. She placed fourth at the 2012 Olympics playing with the Russian team.
